import { set } from "lodash";
import { useState } from "react";

const initialBooks = [
  {
    title: "The Great Gatsby",
    publishedYear: 1925,
    author: "F. Scott Fitzgerald",
  },
  {
    title: "To Kill a Mockingbird",
    publishedYear: 1960,
    author: "Harper Lee",
  },
  {
    title: "1984",
    publishedYear: 1949,
    author: "George Orwell",
  },
  {
    title: "Pride and Prejudice",
    publishedYear: 1813,
    author: "Jane Austen",
  },
];

export default function App() {
  const [books, setBooks] = useState(initialBooks);

  function onAddBook(newBook) {
    console.error("Adding new book:", newBook);
    setBooks((prevBooks) => {
      const updatedBooks = [...prevBooks, newBook];
      console.error("Updated books:", updatedBooks);
      return updatedBooks;
    });
  }

  return (
    <div className="App">
      <Header />
      <AddBookForm onAddBook={onAddBook} />
      <BookList books={books} />
    </div>
  );
}

function Header() {
  return (
    <header className="nav-bar">
      <div className="left-nav">
        ðŸ“•
        <h1>ReadTogether</h1>
      </div>

      <div className="right-nav">
        <input
          className="search-bar"
          type="text"
          placeholder="Search books or friends..."
        />
        <p></p>
      </div>
    </header>
  );
}

function AddBookForm({ onAddBook }) {
  const [title, setTitle] = useState("");
  const [publishedYear, setPublishedYear] = useState("");
  const [author, setAuthor] = useState("");

  function handleAddBook(e) {
    if (!title || !publishedYear || !author) return;

    const newBook = {
      title: title,
      publishedYear: publishedYear,
      author: author,
    };

    onAddBook(newBook);
    setTitle("");
    setPublishedYear("");
    setAuthor("");
  }

  return (
    <form className="add-book-form" onSubmit={handleAddBook}>
      <h2>Add a Book</h2>
      <input
        type="text"
        value={title}
        placeholder="Book Title"
        onChange={(e) => setTitle(e.target.value)}
      />
      <input
        type="text"
        value={author}
        placeholder="Author"
        onChange={(e) => setAuthor(e.target.value)}
      />
      <input
        type="number"
        value={publishedYear}
        placeholder="Published Year"
        onChange={(e) => setPublishedYear(e.target.value)}
      />
      <button type="submit">Add Book</button>
    </form>
  );
}

function BookList({ books }) {
  return (
    <div className="book-list">
      <h2>Giap's BookList</h2>
      <ul>
        {books.map((book) => (
          <Book
            key={book.title}
            title={book.title}
            year={book.publishedYear}
            author={book.author}
          />
        ))}
      </ul>
    </div>
  );
}

function Book({ title, year, author }) {
  const [status, setStatus] = useState("need-to-read");

  return (
    <li>
      <h3>{title}</h3>
      <p>{year}</p>
      <p>{author}</p>
      <select
        className="book-status-select"
        value={status}
        onChange={(e) => setStatus(e.target.value)}
      >
        <option value="need-to-read">Haven't Started</option>
        <option value="reading">In Progress</option>
        <option value="done">Finished</option>
      </select>
    </li>
  );
}
